Kui veepaaki on $20\pi$ kuupmeetrite tunnus, siis see on kauguse $20\pi$ korrutatav volume. Vaidas on $20\pi r^3$, kus $r$ on veepaaki raadius. Kui volume on $20\pi$, siis on $20\pi r^3=20\pi$, see on $r^3=1$, see on $r=1$. Veepaaki on 1 metriga.  \[
\boxed{1}
\]

Raamaturiiulil on $24-8-10-6=0$ matemaatikaraamatut. 3 riiulil on $24$ raamatut, kus $3\cdot 2=6$ raamatut on kolm riiulil. 6 raamatut on 3 matemaatikaraamatut, kus 1 on kolm riiulil. 1 riiulil on 1 matemaatikaraamatut. 1 riiulil on 1/3 osa.  \[
\boxed{\frac{1}{3}}
\]

Kui $\overline{AC}$ poolitab nurka $\angle BAD$, arvutage $\angle BAC$ ja $\angle CAD$. Arvutage $\angle BAC$ ja $\angle CAD$ arvutage $[\triangle ACD]$.  \begin{align*}
\frac{[\triangle ACD]}{[ABCD]}&=\frac{[\triangle ACD]}{[\triangle ACD]+[\triangle ABC]+[\triangle ABD]+[\triangle BCD]}\\
&=\frac{[\triangle ACD]}{[\triangle ACD]+[\triangle ACD]+\frac{1}{2}[\triangle ACD]+[\triangle ACD]}\\
&=\frac{[\triangle ACD]}{\frac{7}{2}[\triangle ACD]}\\
&=\frac{2}{7}
\end{align*}  \[ \Rightarrow [\triangle ACD]=\boxed{\frac{84}{7}} \]

Välja on poolringist $400 \div 2 = 200$ meetrit. Pindala ruutmeetrites on poolringist $200 \div 2 = 100$ meetrit. Välja on poolringist $100 \div 10 = 10$ meetrit. Välja on ümbritsetud spordirajaga, nagu allpool näidatud, kui on 10 meetrit.  \[
\boxed{1000}
\]
